import "./App.css";

import Box from "./components/Box";
import { useState } from "react";

function App() {
  let arr3 = [];
  let id = Date.now();
  for (let i = 0; i < 16; i++) {
    arr3.push({
      id: id + i,
      color: "white",
    });
  }

  const [getColor, setColor] = useState("white");

  const [getItems, setItems] = useState(arr3);

  //   function toBlack() {
  //     setColor("grey");
  //   }
  return (
    <div className="App">
      <div className="wrapper">
        {getItems.map((x, i) => (
          <Box
            key={i}
            id={x.id}
            color={x.color}
            setItems={setItems}
            getItems={getItems}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
